function pointermove( event ) {
	const x = event.clientX;
	const midScreen = event.view.innerWidth / 2;

	if (x > midScreen) {
		rotateDirection = "right";	
	} else if (x < midScreen) {
		rotateDirection = "left";
	} else {
		rotateDirection = "none";
	}
}

function update( event ) {
	let step = 0.01;

	const sphere = this.children[0].children[1];

	if (rotateDirection === "none") {
		return;	
	} 

	if (rotateDirection === "left") {
		step = -0.01;	
	}

	if (rotateDirection === "left" && rotateY <= -0.4) {
		return;
	}

	if (rotateDirection === "right" && rotateY >= 0.4) {
		return;	
	}


	this.rotation.y += step;
	rotateY = this.rotation.y;

	sphere.material.emissive.b += step;
}
